import './App.css';
import LoginSignup from './screan/LoginSignup';
// import { BrowserRouter as Router, Redirect } from 'react-router-dom';
import { ReactKeycloakProvider } from '@react-keycloak/web';
import keycloaks from './keycloak'; // Import your Keycloak configuration
import Home from './Login-signup-pages/Home'; 
import { BrowserRouter } from 'react-router-dom';
import {Route, Routes } from 'react-router-dom';
import { redirect } from 'react-router-dom';

const App = () => {
  console.log("hellooo");
  return (
    <>
   <div>
   <LoginSignup/>
   </div>
   <BrowserRouter>
            <ReactKeycloakProvider authClient={keycloaks}>
                <Routes>
                    <Route path="/home" component={Home} />
                    <redirect from="/" to="/home" /> {/* Redirect root to home */}
                </Routes>
            </ReactKeycloakProvider>
        </BrowserRouter>
    </>


  );
}

export default App;
